import React, { useState } from 'react';

export const LoginPage = ({ onLoginSubmit }) => {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');

  const handleSubmit = async (e) => {
    e.preventDefault();
    onLoginSubmit({ username, password });
  };

  return (
    <div style={{ padding: '20px', backgroundColor: '#f0f0f0', borderRadius: '5px' }}>
      <h2 style={{ color: '#333', marginBottom: '20px' }}>Login Page</h2>
      <form onSubmit={handleSubmit}>
        <label style={{ color: '#333' }}>
          Username:
          <input
            type="text"
            value={username}
            onChange={(e) => setUsername(e.target.value)}
            style={{ marginLeft: '10px' }}
          />
        </label>
        <br />
        <label style={{ color: '#333', marginLeft: '20px' }}>
          Password:
          <input
            type="password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            style={{ marginLeft: '10px' }}
          />
        </label>
        <br />
        <button type="submit" style={{ marginTop: '10px', padding: '5px 10px', backgroundColor: '#007bff', color: '#fff', border: 'none', borderRadius: '3px', cursor: 'pointer' }}>Login</button>
      </form>
    </div>
  );
};


export default LoginPage;
